export const getAttendanceHistoryForUsers = async (userIds: sring[]) => {
  const data = await fetch("http://localhost:5000/event/prediction", {
    method: "GET",
    mode: "no-cors",
    body: JSON.stringify(userIds)
  });
  const dataJson = await data.json();
  return dataJson.data;
};
